import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Card";
import Sdata from "./Sdata"



ReactDOM.render(
  <>
    <h1 className=" text-center m-5 " >This Is Official Netflix Site</h1>

    <Card
       imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        Link={Sdata[0].Link}
    />
    <Card
       imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        sname={Sdata[1].sname}
        Link={Sdata[1].Link}
    />
    <Card
       imgsrc={Sdata[2].imgsrc}
        title={Sdata[2].title}
        sname={Sdata[2].sname}
        Link={Sdata[2].Link}
    />
    <Card
       imgsrc={Sdata[3].imgsrc}
        title={Sdata[3].title}
        sname={Sdata[3].sname}
        Link={Sdata[3].Link}
    />
    <Card
       imgsrc={Sdata[4].imgsrc}
        title={Sdata[4].title}
        sname={Sdata[4].sname}
        Link={Sdata[4].Link}
    />

    {/* <Sdata/> */}
  </>,

  document.getElementById("root")
)
